import React from 'react';
import ReactGantt from 'gantt-for-react';

const Dashboard = () => {

    const tasks = [
        {
          id: 'Task 1',
          name: 'Redesign website',
          start: '2016-12-28',
          end: '2016-12-31',
          progress: 20,
          dependencies: 'Task 2, Task 3'
        },
        {
            id: 'Task 2',
            name: 'A',
            start: '2016-12-18',
            end: '2016-12-31',
            progress: 10,
            dependencies: 'Task 2, Task 3'
          },
          {
            id: 'Task 3',
            name: 'B',
            start: '2016-12-30',
            end: '2016-12-31',
            progress: 30,
            dependencies: 'Task 2, Task 3'
          },
          {
            id: 'Task 4',
            name: 'C',
            start: '2016-12-20',
            end: '2016-12-31',
            progress: 50,
            dependencies: 'Task 2, Task 3'
          },
          {
            id: 'Task 5',
            name: 'D',
            start: '2016-12-28',
            end: '2016-12-31',
            progress: 80,
            dependencies: 'Task 2, Task 3'
          },
    ]



    return (
        <div>
            <ReactGantt
                tasks={tasks}
                viewMode="Day"
            />
        </div>
    )
}

export default Dashboard
